                    </p>
                </div>
                <div className = 'card-action gret lighten-4 grey-text'>
                    <div> Posted by the MrVictor </div>
                    <div> 2nd Setember, 2am </div>
                </div>
            </div>
        </div>
    );
};

export default ProjectDetail;
